fragment CommentsPageComment on Comment {
  id
  postedBy {
    login
    html_url
  }
  createdAt
  content
}query Comment($repoFullName: String!, $limit: Int, $offset: Int) {
  currentUser {
    login
    html_url
    __typename
  }
  entry(repoFullName: $repoFullName) {
    id
    postedBy {
      login
      html_url
      __typename
    }
    createdAt
    comments(limit: $limit, offset: $offset) {
      ...CommentsPageComment
      __typename
    }
    commentCount
    repository {
      full_name
      html_url
      ... on Repository {
        description
        open_issues_count
        stargazers_count
        __typename
      }
      __typename
    }
    __typename
  }
}

