fragment FeedEntry on Entry {
  id
  commentCount
  repository {
    full_name
    html_url
    owner {
      avatar_url
    }
  }
  ...VoteButtons
  ...RepoInfo
},fragment VoteButtons on Entry {
  score
  vote {
    vote_value
  }
},fragment RepoInfo on Entry {
  createdAt
  repository {
    description
    stargazers_count
    open_issues_count
  }
  postedBy {
    html_url
    login
  }
}query Feed($type: FeedType!, $offset: Int, $limit: Int) {
  currentUser {
    login
    __typename
  }
  feed(type: $type, offset: $offset, limit: $limit) {
    ...FeedEntry
    __typename
  }
}

